package org.a.demo.controllers;

import java.util.Date;
import java.util.List;

import org.a.demo.entities.Article;
import org.a.demo.entities.User;
import org.a.demo.security.RoleType;
import org.a.demo.services.ArticleService;
import org.a.demo.services.UserService;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.http.HttpStatus;
import org.springframework.http.ResponseEntity;
import org.springframework.web.bind.annotation.PostMapping;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RestController;

import com.github.javafaker.Faker;

@RestController
@RequestMapping("/test")
public class TestInfoController {

	@Autowired
	private Faker faker;

	@Autowired
	private ArticleService articleService;

	@Autowired
	private UserService userService;
	
	private static final Logger log = LoggerFactory.getLogger(TestInfoController.class);
	
	@PostMapping("/admin/articles/import")
	public ResponseEntity addArticleTestInfo() {
		log.debug("Initializing test articles creation...");
		for (int i = 0; i < 30; i++) {
			Article article = new Article();
			article.setTitle(faker.lorem().sentence());
			article.setAuthor(faker.name().username());
			article.setPublishDate(faker.date().between(new Date(Long.valueOf("1514761200000")),
					new Date(Long.valueOf("1604185200000"))));

			Article createdArticle = articleService.create(article);
			log.debug(String.format("Article with id %s has been created", createdArticle.getId()));
		}

		log.debug("Finished test articles creation");
		return new ResponseEntity(HttpStatus.OK);
	}

	@PostMapping("/admin/user/import")
	public ResponseEntity addTestUsers() {
		for (int i = 0; i < 5; i++) {
			User user = new User(faker.name().username(), faker.internet().password(8, 16),
					RoleType.values()[faker.random().nextInt(0, 2)]);

			userService.create(user);
		}

		return new ResponseEntity(HttpStatus.OK);
	}

	@PostMapping("/articles/update")
	public ResponseEntity updateArticleTestInfo() {
		log.debug("Initializing test articles update...");
		List<Article> articles = articleService.getArticles();
		
		articles.forEach(item -> {
			item.setImage("data:image/jpeg;base64,");
			articleService.update(item.getId(), item);
			log.debug(String.format("Article with id %s has been updated", item.getId()));
		});

		return new ResponseEntity(HttpStatus.OK);
	}
	
	@PostMapping("/articles/randomArticle")
	public ResponseEntity createRandomArticle() {
		Article article = new Article.Builder()
				.setInfo(faker.lorem().sentence(), 
						new Date(), faker.name().username())
				.setSubtitle(faker.lorem().sentence())
				.setImage("data:image/jpeg;base64,")
				.addParagraph(faker.lorem().paragraph(4))
				.addBodyTitle(faker.lorem().sentence())
				.addParagraph(faker.lorem().paragraph(5))
				.addBodyImage("data:image/jpeg;base64,")
				.addParagraph(faker.lorem().paragraph(3))
				.addQuote(faker.lorem().sentence(), faker.name().fullName())
				.addParagraph(faker.lorem().paragraph(2))
				.build();
		return new ResponseEntity<Article>(articleService.create(article), HttpStatus.OK); 
	}

}
